import React, { useState } from 'react';
import './App.css';

const App = () => {
    const [ input, setInput ] = useState('')
    const handleChange = (e) => {
        setInput(e.target.value)
    }
    return (
        <div className="App">
            <label>find countries</label>
            <input type="text" name="country" onChange={handleChange}></input>
        </div>
    );
}

export default App;
